import Header from '../components/Header';
import SideNav from '../components/SideNav';
import TopBarNav from '../components/TopBarNavigator'

export default class Index extends React.Component {
    render() {
        return (
            <div style={{flexDirection: 'column', display: 'flex', height: "100%", width: "100%", margin: 0, marginLeft: 0}}>
                
                <TopBarNav />
                <div style={{flex: 1, display:'flex', flexDirection: 'row'}}>
                    <SideNav />
                    <div style={{ background: '#E8E8E8', flex: 1, display: 'flex', alignItems: 'center',flexDirection: 'column' }}>
                        <text >
                            My Portfolio
                    </text>

                    </div>
                </div>
                
            </div>
        )
    }
}
